**Describe the bug**
I am implementing in C language referring to the Contrib Operator document of ONNX Runtime. However, the QLinearConv I implemented and the QLinearConv of ONNX Runtime show different output values, so I want to review whether the implementation is correct.

First, QLinearConv is implemented to operate in the following steps.
Step1) Convolution
Step2) Quantize

A part of the source code of Step1 is as follows.

STEP 1 : Convolution
TYPE(INT8, UINT8)
-> If there is a problem with the convolution algorithm, please point it out

```
static void conv_2d_TYPE_INT8(TYPE* X_buffer, int32* X_shape, Tensor* x_zero_point,
                                    int8* W_buffer, int32* W_shape, Tensor* w_zero_point,
                                    int32* Temp_buffer, int32* dilations, int32* strides, int32* pads){
    int32 height_dilations = 0;
    TYPE x_zp = ((TYPE*)x_zero_point->buffer)[0];
    int8 w_zp = ((int8*)w_zero_point->buffer)[0];

    for(int32_t W_height = 0; W_height < W_shape[2]; W_height++) {
        int32 Y_unit = 0;
        for(int32 X_height = -pads[0]; X_height < X_shape[2] + pads[2] - dilations[0] * (W_shape[2] - 1); X_height += strides[0]) {
            for(int32 X_width = -pads[1]; X_width < X_shape[3] + pads[3] - dilations[1] * (W_shape[3] - 1); X_width += strides[1]) {
                for(int32 W_width = 0; W_width < W_shape[3]; W_width++) {
                    **if(X_height + height_dilations < 0 || X_width + W_width * dilations[1] < 0 || X_height + height_dilations > X_shape[2] - 1 || X_width + W_width * dilations[1] > X_shape[3] - 1) {
                        Temp_buffer[Y_unit] += 0;
                    } else {
                        Temp_buffer[Y_unit] += (int32)(X_buffer[(X_height + height_dilations) * X_shape[3] + X_width + W_width * dilations[1]] - x_zp) * (int32)(W_buffer[W_height * W_shape[3] + W_width] - w_zp);
                    }**
                }
                Y_unit++;
            }
        }
        height_dilations += dilations[0];
    } 
}
```

A part of the source code of Step2 is as follows.

STEP 2 : Quantize
-> If the rounding rule or the clip rule is wrong, please point it out
-> dst array == y array

```
static void quantize_output_TYPE(int32 count, TYPE* dst, int32* src, float32 x_scale, float32 w_scale, float32 y_scale, TYPE y_z, int32 y_type){
    **float64 val = (float64)x_scale * (float64)w_scale / (float64)y_scale;**
    if( y_type == 2) {
        for(int32 i = 0; i < count; i++) {
            float32 rounded_val = **nearbyintf(**(float64)src[i] * val);            
            if(rounded_val + (int32)y_z <= 0) {
                dst[i] = (uint8)0;
            } else if(rounded_val  + (int32_t)y_z >= 255) {
                dst[i] = (uint8)255;
            } else {
                dst[i] = (uint8)((rounded_val) + y_z);
            }
        } 
    } else {
        for(int32 i = 0; i < count; i++) {
            float32 rounded_val = **nearbyintf((**float64)src[i] * val);            
            if(rounded_val + (int32)y_z <= -128) {
                dst[i] = (int8)-128;
            } else if(rounded_val  + (int32_t)y_z >= 127) {
                dst[i] = (int8)127;
            } else {
                dst[i] = (int8)((rounded_val) + y_z);
            }
        } 
    }
}
```

The following source code is a part of main that calls the functions of Step1 and Step2.

main code
- Temp_buffer : type - int32
- Temp_buffer is a temporary y_buffer for weight reduction after calculating as int32.

```
                for (int32 batch = 0; batch < batch_count; batch++) {
                    for(int32 feature = 0; feature < feature_count; feature++) {
                        int32 g = feature / feature_group;

                        for(int32 channel = 0; channel < channel_count; channel++) {
                            TYPE* X_buffer = X_flatten + X_unit * (channel_count * g + channel);
                            int8* W_buffer = W_flatten + W_unit * (channel_count * feature + channel);
                            // step1 : convolution data
                            **conv_2d_TYPE_INT8(X_buffer, X_shape, x_zero_point,
                                                    W_buffer, W_shape, w_zero_point,
                                                    _Temp_buffer_, dilations, strides, pads);**
                        }
                        
                        if(B_buffer != NULL) {
                            int32 bias = B_buffer[feature];
                            for(int32 i = 0; i < Y_unit; i++) {
                                Temp_buffer[i] += bias;
                            }
                        }
                        Temp_buffer += Y_unit;
                    }

                    X_flatten += X_unit * channel_count * group;
                }
                // step 2 : quantize
                **quantize_output_TYPE(Y_total, Y_buffer, Temp_buffer - Y_total, x_scale, w_scale, y_scale, y_zeropoint, y_zero_point->dtype);**
```

Here are the questions to ask:
1. In Step2 (Quantize), I used the nearbyintf() function of math.h to use the same rounding rule as the QLinearAdd Operator. Is it implemented correctly?
2. Am i using casting correctly when calculating different types of data? (for both Step1 and Step2)
3. In Step1 (Convolution), is there anything not specified in the Contrib Operator documentation? (Convolution algorithm refer to ONNX Operator document)

